import (
	context "context"
	rapiddocs "github.com/go-content-type/rapiddocs"
	rapiddocsclient "github.com/go-content-type/rapiddocs/client"
	option "github.com/go-content-type/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Imdb.CreateMovie(
	context.TODO(),
	&rapiddocs.CreateMovieRequest{
		Title:  "title",
		Rating: 1.1,
	},
)
